// import styles from './VideoList.module.css';
import VideoCard from "../VideoCard/VideoCard";

const VideoList = (videos) => {
    return <ul>
        { videos.map(video => {
            <li><VideoCard id={video.id} preview={video.preview} title={video.title}/></li>
        }) }
    </ul>
};

export default VideoList;
